import React from 'react';
import Footer from './components/Footer';
import Header from './components/Header';

const App = () => {
  return (
    <>
     <Header/>
     <main>
       <h1>Welcome to Raboy's E-Commerce Shop</h1>
     </main>
     <Footer/>
    </>
  );
}

export default App;
